 Vi beteckar片nas \(a\), \(b\), \(c\) med \(a \leq b \leq c\). Vi sitrer att med maximna uppikt \(c\) med med \
\(a, b, c\) med med"c\) av \(a, b, c\) = \( \frac{a + b + c}{3} \).

1. ** builds up the equations:**

   - Sum of the three numbers:
     \[
     a + b + c = 120
     \]

   - Sum of the three numbers divided by 3 (median):
     \[
     \frac{a + b + c}{3} = 24
     \]

2. **Calculate the sum using the median information:**

   \[
   \frac{a + b + c}{3} = 24 \implies a + b + c = 24 \times 3 = 72
   \]

3. **Identify a contradiction:**

   - We are given that \(a + b + c = 120\), but using the median, we calculated \(a + b + c = 72\).

 4. **Recheck the problem context:**

   - Given that the sum \(a + b + c = 120\) and the median of the numbers is 24, we need to consider that these are distinct integers.

5. **Re-evaluate the median calculation:**

   - Given that the median is 24, and the numbers are \(a, b, c\) where \(a \leq b \leq c\), we assume \(b = 24\).

6. **Substitute \(b = 24\) into the sum equation:**

   \[
   a + 24 + c = 120
   \]

7. **Solve for \(a + c\):**

   \[
   a + c = 120 - 24 = 96
   \]

8. **Determine the maximum value \(c\):**

   - Since \(a \leq b \leq c\), the maximum value \(c\) would be as large as possible. To find the maximum value, we need to minimize \(a\).

   - Let \(a\) be the smallest integer possible while keeping \(a \leq b =  24\). The smallest possible \(a\) is 1 (assuming \(a\) is a positive integer).

   - Thus:
     \[
     1 + c = 96 \implies c = 96 - 1 = 95
     \]

9. **Conclusion:**

   The largest of the three numbers is \(\boxed{95}\). 

   \[
   \boxed{95}
